import React from "react";
import { HeaderBox } from "../style/style";

export const Header = () => {
  return (
    <div>
      <HeaderBox>
        <p>
          A collective list of free APIs for use in <br />
          software and web development.
        </p>
        <input type="text"></input>
      </HeaderBox>
    </div>
  );
};
